import { useState } from 'react';
import { useEffect } from 'react';
import './game.css'
const Game = () => {
    const[snake,newsnake]=useState([{x:30,y:30},{x:40,y:30},{x:50,y:30}])
    return (  
        <div id="gamepage">
            <div id="box">
             {snake.map((element)=>{
               return <div className="snakeelement" style={{left:`${element.x}px`,top:`${element.y}px`}}></div>
             })}                
            </div>
        </div>
    );
}
 
export default Game;
